import React from "react";
import styled from "styled-components";

const ContactForm = () => {
  return (
    <Container>
      <FormBox></FormBox>
    </Container>
  );
};

export default ContactForm;

const Container = styled.div`
  width: 100vw;
  height: 100vh;
`;

const FormBox = styled.div`
  width: 80%;
  margin: 0 auto;
  background-color: #efefef;
`;
